import { Children, ReactNode } from 'react';

import { Container } from './styles';

export interface ButtonProps {
  handleRoute?(): void;
  href?: string;
  onClick?(): void;
  children?: ReactNode;
}

function Button( props : ButtonProps) {

  return (
    <Container href={props.href} onClick={props.onClick}>
      {Children}
    </Container>
  );
};

export default Button;
